app.controller("home",["$scope","appointmentAPIService","storageService","dialogService","routeService",function(n,t,i,r,u){t.getTodayAppointmentCount().then(function(t){n.appointmentTodayCound=t.data});n.userTypeId=i.getUserTypeId();n.userTypeId==2&&t.getRecentAppointment().then(function(t){if(n.recentAppointment=t.data,n.recentAppointment!=null){var r=new Date(n.recentAppointment.appointmentDate.replace("T"," ")),u=new Date,i=parseInt((r-u)/6e4);n.remainderHours=parseInt(i/60);n.remainderMinutes=i=i%60}});n.scan=function(){window.control!=undefined?control.scan("aoscan"):r.showMention(1,"扫码只能在集云美邦手机APP中使用")};n.scanResult=function(n){/^[a-zA-Z0-9]+-[a-zA-Z0-9]+-[a-zA-Z0-9]+-[a-zA-Z0-9]+-[a-zA-Z0-9]+$/.test(n)==!1?r.showMention(1,"无效消费码"):u.goParams("check_scan",{consumeCode:n})}}]);